import React from 'react';
import ReportQuestion from './ReportQuestion.js';

class ReportEdit extends React.Component {

    render() {
        return (
            <div className="login_container">
                <form className="form_login" onSubmit={this.handleSubmit}>
                    <label className="input_label">
                        Email
                        <input
                            required
                            name="email"
                            type="email"
                            onChange={this.handleOnChange}
                        />
                    </label>

                    <label className="input_label">
                        Password
                        <input
                            required
                            name="password"
                            type="password"
                            onChange={this.handleOnChange}
                        />
                    </label>


                    <input name="register" type="Submit" defaultValue="Register" className="button_submit"/>

                </form>
            </div>
        )
    }
}

export default ReportEdit;
